import React, { useState } from 'react'
import { createContext } from 'react'
import Main from './Main'

const Properties = createContext()

const App = () => {

  const [count, setcount] = useState(5)

  const Increment = () => {
    setcount(count + 1)
  }
  const Decrement = () => {
    setcount(count - 1)
  }

  return (

    <div className='app'>
      <Properties.Provider
        value={{
          count: count,
          inc_fun: Increment,

        }}>
        <Main />
      </Properties.Provider>
    </div>
  )
}

export default App
export { Properties };
